import Card from "../Components/Card.vue";
import Last from "../Components/Icons/Home/Last.vue";
import Put from "../Components/Icons/Put.vue";
import Get from "../Components/Icons/Get.vue";
import Conversion from "../Components/Icons/Conversion.vue";
const Icons = {
  history: Last,
  put: Put,
  get: Get,
  conversion: Conversion
};
export default {
  components: {
    Card,
    Last,
    Put,
    Get,
    Conversion
  },
  data() {
    return {
      tabs: [{
        id: "history",
        path: "/atm/history/all",
        name: "Последние операции",
        isFilled: false
      }, {
        id: "put",
        path: "/atm/management/put",
        name: "Пополнить \n счет",
        isFilled: true
      }, {
        id: "get",
        path: "/atm/management/get",
        name: "Снять \n наличные",
        isFilled: true
      }, {
        id: "conversion",
        path: "/atm/conversion",
        name: "Переводы",
        isFilled: true
      }]
    };
  },
  methods: {
    getIcon(tabId) {
      return Icons[tabId];
    },
    setActiveTab(tab) {
      this.$router.push(tab.path);
    }
  },
  created() {
    this.$callClient("C:ATM:HomeReady");
  },
  beforeUnmount() {
    this.$callClient("C:ATM:HomeDestroyed");
  }
};
